const SkeletonCategory = () => {
  return (
    <>
      <div className="grid">
        <div>
          <div className="grid-box-wrapper">div.grid-box</div>
        </div>
      </div>
      <style jsx>
        {`
          .grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-gap: 2rem;
            padding: 0 2rem;
          }

          .grid-box-wrapper {
            position: relative;
            padding-top: 100%;
          }

          .grid-box {
            height: 100%;
            width: 100%;
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            background-color: #eee;
          }
        `}
      </style>
    </>
  );
};

export default SkeletonCategory;
